  "translationLines": [
    {
      "lineNumber": 217132,
      "originalJapaneseLine": "志津香も近くの階段に腰掛けて、",
      "translatedEnglishLine": "Shizuka also sat down on the nearby stairs,"
    },
    {
      "lineNumber": 217133,
      "originalJapaneseLine": "休憩する構えを見せた。",
      "translatedEnglishLine": "showing signs of taking a break."
    },
    {
      "lineNumber": 217134,
      "originalJapaneseLine": "「くっ……どいつもこいつも……",
      "translatedEnglishLine": "\"Ugh... every single one of them..."
    },
    {
      "lineNumber": 217135,
      "originalJapaneseLine": "　俺の部隊の奴ならブン殴ってるところだぞ」",
      "translatedEnglishLine": "If they were in my unit, I'd be punching them right now.\""
    },
    {
      "lineNumber": 217136,
      "originalJapaneseLine": "「ねえ、ザンスちゃん……",
      "translatedEnglishLine": "\"Hey, Zansu-chan..."
    },
    {
      "lineNumber": 217137,
      "originalJapaneseLine": "　＜エール＞ちゃんじゃ駄目？」",
      "translatedEnglishLine": "Wouldn't <Yell>-chan be okay?\""
    },
    {
      "lineNumber": 217138,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 217139,
      "originalJapaneseLine": "「はぁぁぁ……」",
      "translatedEnglishLine": "\"Haaa...\""
    },
    {
      "lineNumber": 217140,
      "originalJapaneseLine": "「＜エール＞じゃ駄目もクソもあるか。",
      "translatedEnglishLine": "\"It's not about <Yell> being bad or not."
    },
    {
      "lineNumber": 217141,
      "originalJapaneseLine": "　俺様がリーダーじゃないってのが問題なんだよ」",
      "translatedEnglishLine": "The problem is that I'm not the leader.\""
    },
    {
      "lineNumber": 217142,
      "originalJapaneseLine": "「むむ！」",
      "translatedEnglishLine": "\"Hmm!\""
    },
    {
      "lineNumber": 217143,
      "originalJapaneseLine": "「やいやいやい！",
      "translatedEnglishLine": "\"Hey, hey, hey!"
    },
    {
      "lineNumber": 217144,
      "originalJapaneseLine": "　さっきから黙って聞いてればお前――」",
      "translatedEnglishLine": "If you'd just been quiet and listened until now—you—\""
    },
    {
      "lineNumber": 217145,
      "originalJapaneseLine": "「あんっ！」",
      "translatedEnglishLine": "\"Ahn!\""
    },
    {
      "lineNumber": 217146,
      "originalJapaneseLine": "即、長田君は割られた。",
      "translatedEnglishLine": "Immediately, Nagata-kun was smashed."
    },
    {
      "lineNumber": 217147,
      "originalJapaneseLine": "「おい、＜エール＞」",
      "translatedEnglishLine": "\"Hey, <Yell>.\""
    },
    {
      "lineNumber": 217148,
      "originalJapaneseLine": "ザンスがあなたの前に立つ。",
      "translatedEnglishLine": "Zansu stood in front of you."
    },
    {
      "lineNumber": 217149,
      "originalJapaneseLine": "「お前、リーダー出来る自信があるのか？」",
      "translatedEnglishLine": "\"Do you have confidence that you can be the leader?\""
    },
    {
      "lineNumber": 217150,
      "originalJapaneseLine": "「…………。」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 217151,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 217152,
      "originalJapaneseLine": "「おっ、いいぞ、＜エール＞！　よく言った！」",
      "translatedEnglishLine": "\"Oh, good, <Yell>! Well said!\""
    },
    {
      "lineNumber": 217153,
      "originalJapaneseLine": "「大体なぁ、＜エール＞には、",
      "translatedEnglishLine": "\"Basically, <Yell> has,"
    },
    {
      "lineNumber": 217154,
      "originalJapaneseLine": "　この絶世の美男子ハニー、長田君がいるわけ！",
      "translatedEnglishLine": "this peerless handsome honey, Nagata-kun!"
    },
    {
      "lineNumber": 217155,
      "originalJapaneseLine": "　俺たちゃ一心同体だから！　マジで！」",
      "translatedEnglishLine": "We're like one soul! Seriously!\""
    },
    {
      "lineNumber": 217156,
      "originalJapaneseLine": "「二人で力を合わせりゃリーダーとして――」",
      "translatedEnglishLine": "\"If the two of us combine our strength as leaders—\""
    },
    {
      "lineNumber": 217157,
      "originalJapaneseLine": "「あんっ！」",
      "translatedEnglishLine": "\"Ahn!\""
    },
    {
      "lineNumber": 217158,
      "originalJapaneseLine": "長田君は粉々に割られた。",
      "translatedEnglishLine": "Nagata-kun was shattered into pieces."
    },
    {
      "lineNumber": 217159,
      "originalJapaneseLine": "「……おい、リセット」",
      "translatedEnglishLine": "\"...Hey, Reset.\""
    },
    {
      "lineNumber": 217160,
      "originalJapaneseLine": "「大丈夫大丈夫！",
      "translatedEnglishLine": "\"It's okay, it's okay!"
    },
    {
      "lineNumber": 217161,
      "originalJapaneseLine": "　＜エール＞ちゃんなら大丈夫だよ！」",
      "translatedEnglishLine": "If it's <Yell>-chan, it'll be fine!\""
    },
    {
      "lineNumber": 217162,
      "originalJapaneseLine": "「この流れでよく満面の笑みで断言できるな……」",
      "translatedEnglishLine": "\"To say that with such a full smile after all this...\""
    },
    {
      "lineNumber": 217163,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 217164,
      "originalJapaneseLine": "「ちっ！」",
      "translatedEnglishLine": "\"Tch!\""
    },
    {
      "lineNumber": 217165,
      "originalJapaneseLine": "「あーあー、くっだらねぇ！",
      "translatedEnglishLine": "\"Ugh, how ridiculous!"
    },
    {
      "lineNumber": 217166,
      "originalJapaneseLine": "　ピクニック気分のテメェらに",
      "translatedEnglishLine": "You guys, feeling like it's a picnic,"
    },
    {
      "lineNumber": 217167,
      "originalJapaneseLine": "　なに言っても無駄ってのはよく分かった！」",
      "translatedEnglishLine": "I understand well that whatever I say to you is useless!\""
    },
    {
      "lineNumber": 217168,
      "originalJapaneseLine": "「勝手にしろ！」",
      "translatedEnglishLine": "\"Do as you please!\""
    },
    {
      "lineNumber": 217169,
      "originalJapaneseLine": "「だが！　そいつが情けないことしたら",
      "translatedEnglishLine": "\"But! If that guy does something pathetic,"
    },
    {
      "lineNumber": 217170,
      "originalJapaneseLine": "　いつでも俺がリーダーやんぞ！」",
      "translatedEnglishLine": "I'll be the leader anytime!\""
    },
    {
      "lineNumber": 217171,
      "originalJapaneseLine": "「おい、＜エール＞。",
      "translatedEnglishLine": "\"Hey, <Yell>."
    },
    {
      "lineNumber": 217172,
      "originalJapaneseLine": "　せいぜいとっとと泣きを入れることだな」",
      "translatedEnglishLine": "You'd better hurry up and admit defeat.\""
    },
    {
      "lineNumber": 217173,
      "originalJapaneseLine": "「はんっ！」",
      "translatedEnglishLine": "\"Hmph!\""
    },
    {
      "lineNumber": 217174,
      "originalJapaneseLine": "「おい、ロッキー。",
      "translatedEnglishLine": "\"Hey, Rocky."
    },
    {
      "lineNumber": 217175,
      "originalJapaneseLine": "　俺にもコーヒー、砂糖三つ」",
      "translatedEnglishLine": "Give me coffee too, with three sugars.\""
    },
    {
      "lineNumber": 217176,
      "originalJapaneseLine": "「は、はいだす」",
      "translatedEnglishLine": "\"Y-yes, coming right up.\""
    },
    {
      "lineNumber": 217177,
      "originalJapaneseLine": "「んふふ〜。",
      "translatedEnglishLine": "\"Nfufu~."
    },
    {
      "lineNumber": 217178,
      "originalJapaneseLine": "　ザンスちゃん、ありがとう！」",
      "translatedEnglishLine": "Thank you, Zansu-chan!\""
    },
    {
      "lineNumber": 217179,
      "originalJapaneseLine": "「えへへへへー……",
      "translatedEnglishLine": "\"Ehehehehe..."
    },
    {
      "lineNumber": 217180,
      "originalJapaneseLine": "　大人になったのねえ……」",
      "translatedEnglishLine": "You've grown up...\""
    },
    {
      "lineNumber": 217181,
      "originalJapaneseLine": "「だーっ、うっとうしい！　ベタベタすんな！」",
      "translatedEnglishLine": "\"Ugh, you're so annoying! Don't be so clingy!\""
    },
    {
      "lineNumber": 217182,
      "originalJapaneseLine": "「俺の周りの女ってなぁ、",
      "translatedEnglishLine": "\"The women around me are all like,"
    },
    {
      "lineNumber": 217183,
      "originalJapaneseLine": "　こんな奴ばっかりか……」",
      "translatedEnglishLine": "this kind of person, huh...\""
    },
    {
      "lineNumber": 217184,
      "originalJapaneseLine": "ザンスは溜め息を吐きながら、",
      "translatedEnglishLine": "Zansu let out a sigh,"
    },
    {
      "lineNumber": 217185,
      "originalJapaneseLine": "ロッキーからコーヒーを受け取った。",
      "translatedEnglishLine": "and took coffee from Rocky."
    },
    {
      "lineNumber": 217186,
      "originalJapaneseLine": "「むかむかむかぁ〜〜……！」",
      "translatedEnglishLine": "\"Ugh, so irritating~~...!\""
    },
    {
      "lineNumber": 217187,
      "originalJapaneseLine": "「なんだよ、あいつー！",
      "translatedEnglishLine": "\"What's with that guy—!"
    },
    {
      "lineNumber": 217188,
      "originalJapaneseLine": "　好き放題言いやがって！」",
      "translatedEnglishLine": "Saying whatever he wants!\""
    },
    {
      "lineNumber": 217189,
      "originalJapaneseLine": "「あはは、ごめんねぇ」",
      "translatedEnglishLine": "\"Ahaha, sorry about that.\""
    },
    {
      "lineNumber": 217190,
      "originalJapaneseLine": "リセットがとことこと現れる。",
      "translatedEnglishLine": "Reset appeared, walking over."
    },
    {
      "lineNumber": 217191,
      "originalJapaneseLine": "「ザンスちゃんにとって、",
      "translatedEnglishLine": "\"For Zansu-chan,"
    }
  ]
}

